import React from "react";
import NavHorizontal from "./NavHorizontal";
import NavVertical from "./NavVertical";

const LeftSidebarMenu: React.FC = () => {
  return (
    <React.Fragment>
      <NavVertical/>
      <NavHorizontal/>
    </React.Fragment>
  );
};

export default LeftSidebarMenu;
